3675.objetoCompra:
Contratação de  empresa especializada na prestação de serviços de manutenção preventiva e corretiva na viatura I/NISSAN SENTRA 20SV CVT 2016/2017  utilizada pelo Diretor desta Diretoria. Contratação de serviço do ramo de reparação de veículos automotores, especializada em manutenção preventiva e corretiva com a necessária reposição de peças originais, necessários à operação eficiente e segura da frota de viaturas da Diretoria de Assistência Social da Marinha, outrossim, participo que seja oficina prestadora dos serviços localizada a um raio distância de localidade de 20km desta Diretoria e que não seja área de risco pelo motivo de ser serviço em viatura militar.
Serão realizados 14 itens:
1) Troca de óleo (Motor Flex – 05litros);
2) Troca do Filtro de óleo;
3) Troca Filtro de combustível;
4) Troca Filtro de ar motor;
5) Troca Filtro de cabine;
6) Limpeza do sistema de arrefecimento + 06 litros de aditivos radiador;
7) Limpeza de bicos injetores;
8) Jogo de palhetas limpador para-brisa;
9)  Lâmpada Placa (02 unidades);
10)  Reparo para-choque traseiro;
11) Insulfilm (Retirada e instalação);
12) Jogo pastilhas de freio - dianteiras;
13) Troca do Refil da bomba combustível; e
14) Troca do Regulador de pressão .

